createRandomMashup: function(json, num){
  var length = json.length,
  r1 = Math.random()*length >> 0,
  r2 = Math.random()*length >> 0,
  r3 = Math.random()*length >> 0;

  $('body').find('table').hide().end();

  function appendAPI(obj, num) {
    var html = '<div class="box"><span class="number">'+num+'</span>' + '<h2>' + obj.name + '</h2>' + '<p>' + obj.description + '</p><a target="_blank" href="https://www.google.com/search?q='+obj.name.split(' ').join('+')+'">Learn More</a>' + '<small>(' + obj.category + ')</small>' + '</div>';
    $('.container').append(html);
  }
  console.log(json);

  appendAPI(json['apis'][r1], 1);
  appendAPI(json['apis'][r2], 2);
  appendAPI(json['apis'][r3], 3);
  return;
}
